import React,{createContext} from "react";
import Sec from './body'

var My = createContext();
var _My = createContext();

const X = () =>{
  return (
    <>
      <My.Provider value={'Maninder'}>
        <_My.Provider value={'singh'}>
          <Sec/>
        </_My.Provider>
      </My.Provider>
    </>
  )
}

export default X;
export {My,_My};
